import React from 'react';
import logo from './logo.svg';
import './App.css';
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>
function App() {
  return (
    <div className="App">
<h1>File Upload Service</h1>
<form>
  <input type='text' placeholder="Search for a Title.." name='search'></input>
  <button type='submit'></button>
  <label>Title</label>
  <input name='title' type='text'></input>
  <button>Load</button><br/>
  <label>Date</label>
  <input name='date' type='date'></input>
  <label>Reference</label>
  <input name='reference' type='text'></input><br/>
  <label>Content Type</label> <br/>
  <label>Preach</label> 
  <input name='contentradio' type='radio' id='preach' value='preach'/><br/>
  <label>Music</label> 
  <input name='contentradio' type='radio' id='music' value='music'/><br/>

</form>
    </div>
  );
}

export default App;
